import React from 'react';
import { View } from 'react-native';

export default function App() {
  return (
    <View style={{
      backgroundColor: "#fff",
      flex: 1,
    }}>
      <View style={{
        backgroundColor: 'dodgerblue',
        flex: 1,
      }}/>
      <View style={{
        backgroundColor: 'dodgerblue',
        flex: 1,
      }}/>
      <View style={{
        backgroundColor: 'dodgerblue',
        flex: 1,
      }}/>
    </View>
  ); 
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    paddingTop: Platform.OS === "web" || Platform.OS === "android" ? StatusBar.currentHeight: 0,
  },
});
